port: 7890
socks-port: 7891
allow-lan: true
mode: Rule
log-level: info
external-controller: :9090
proxy-providers:
 订阅名称1:
   type: http
   path: ./profiles/proxies/订阅名称1.yaml
   url: 你的订阅链接1
   interval: 86400 
   health-check:
       enable: true
       interval: 600
       url: http://www.gstatic.com/generate_204

 订阅名称2:
   type: http
   path: ./profiles/proxies/订阅名称2.yaml
   url: 你的订阅链接2
   interval: 86400 
   health-check:
       enable: true
       interval: 600
       url: http://www.gstatic.com/generate_204

proxy-groups:
- name: 节点选择
  type: select
  proxies:
      - FALLBACK
      - DIRECT
  use: 
   - 订阅名称1
   - 订阅名称2

- name: FALLBACK
  type: fallback
  use: 
   - 订阅名称1
   - 订阅名称2
  url: 'http://www.gstatic.com/generate_204'
  interval: 300

- name: 香港节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '香港'

- name: 台湾节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '台湾'

- name: 新加坡节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '新加坡'

- name: 日本节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '日本'

- name: 美国节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '美国'

- name: 马来西亚节点
  type: select
  use: 
   - 订阅名称1
   - 订阅名称2
  filter: '马来西亚'

- name: NETFLIX
  type: select
  proxies:
      - 香港节点
      - 台湾节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: DISNEY+
  type: select
  proxies:
      - 香港节点
      - 台湾节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: YOUTUBE
  type: select
  proxies:
      - 香港节点
      - 台湾节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: PRIMEVIDEO
  type: select
  proxies:
      - 新加坡节点
      - 香港节点
      - 台湾节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: HBO
  type: select
  proxies:
      - 台湾节点

- name: BAHAMUT
  type: select
  proxies:
      - 台湾节点

- name: 苹果服务
  type: select
  proxies:
      - DIRECT
      - 马来西亚节点
      - 香港节点
      - 台湾节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: 电报信息
  type: select
  proxies:
      - 节点选择
      - 台湾节点      
      - 香港节点
      - 新加坡节点
      - 日本节点
      - 美国节点

- name: GOOGLE
  type: select
  proxies:
      - 节点选择
      - 台湾节点      
      - 香港节点
      - 新加坡节点
      - 日本节点
      - 美国节点

- name: 微软服务
  type: select
  proxies:
      - DIRECT
      - 台湾节点      
      - 香港节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: 国外媒体
  type: select
  proxies:
      - 台湾节点      
      - 香港节点
      - 新加坡节点
      - 日本节点
      - 美国节点
      - 节点选择

- name: 国内APP
  type: select
  proxies:
      - 全球直连

- name: 全球直连
  type: select
  proxies:
      - DIRECT
- name: 全球拦截
  type: select
  proxies:
      - REJECT
- name: 应用净化
  type: select
  proxies:
      - REJECT
- name: 漏网之鱼
  type: select
  proxies:
      - 全球直连
      - 节点选择

